    null,ntt"hash": "",ntt"description": "Primary attributes are available
    from the GNIS XML service. Instructions: Insert desired parameter value(s) in single
    quotes following the equals sign. Do not change or delete unused parameters. Parameter
    definitions: fname = feature name. (Exact match. Not case sensitive.) state = state
    name. (Exact match. Case sensitive.) cnty = county name. (Exact match. Not case
    sensitive.) cell = USGS standard topographic map name. (Exact match. Not case sensitive.)
    ftype = feature type (class). See the GNIS public query page (http://geonames.usgs.gov/pls/gnispublic/).
    The pick list for feature class contains the values. Note that the value (populated
    place) in the pick list is abbreviated (ppl) in the data. See question 14, How can
    I acquire GNIS data?, of our FAQ (http://geonames.usgs.gov/domestic/faqs.htm) for
    more details and sample URLs. As currently implemented, it is for relatively small
    data set queries not for mass downloads. It does not include all attributes. Customized
    files of large data sets also can be provided on request in most standard formats.
    The data is presented in format XML.",ntt"format": "XML",ntt"tracking_summary":
