    null,ntt"hash": "",ntt"description": "Data extract files for States
    and territories are available for download via web browser. Topical extracts of
    the data base are also available: the U.S. Populated Places File lists information
    about all communities throughout the United States that are described in the database;
    the U.S. Concise File lists information about major physical and cultural features
    throughout the United States that are described in the database; the Historical
    Features File lists information about features which are no longer in existence
    and/or no longer serve their original purpose; the All Names File lists all names,
    both official and nonofficial (variant), for all features in the nation; and the
    Antarctica File contains entries throughout the continent of Antarctica as approved
    for use by the United States Government. The data is presented in format ASCII,
